As I reach another birthday, my high school yearbook quote comes to mind:

“I drove by the fork in the road & went straight.” - Jay-Z.

Grateful for this journey and this marathon called life. Here are a list of things I’m thankful for: 

for the forks in the road,

for unpaved lanes,

for the dreams without a blueprint, 

for this maze that amazes me, 

for the grace from the most gracious,

for the village that it continues to take,

for creativity that became a safe space,

for the glimmers of hope, 

for the calling that keeps on calling, 

for the pebbles that were once in my shoes,

for the mountains left to climb,

for the greatest blessing that we call time,

… and most importantly for my mother’s love that has always felt like home, a feeling so divine.

May we always DreamOutLOUD as we shine from within.

with love, ~ neimerDreamer 🏁🖤💫

